import React from 'react';
import { Box, Typography } from '@material-ui/core';

const Home = () => {
  return (
    <Box display="flex" justifyContent="center" alignItems="center" height="100vh">
      <Typography variant="h2">You made it</Typography>
    </Box>
  );
};

export default Home;
